export default async function adjustNextTrimmingDate({clientInfo:t}){try{const r=document.getElementById("next-trim-date"),e=document.getElementById("trim-date"),a=t.trim_cycle;await adjustTrimDate(e,a);r.value=await adjustTrimDate(e,a)}catch(t){const{handleError:r}=await import("../../../../../utils/error-messages/handleError.js");await r("adjustNextTrimmingDateError","Adjust next trimming date error: ",t)}}async function adjustTrimDate(t,r){try{const e=new Date(t.value);e.setDate(e.getDate()+parseInt(r,10));const a=e.getFullYear(),n=String(e.getMonth()+1).padStart(2,"0");return`${a}-${n}-${String(e.getDate()).padStart(2,"0")}`}catch(t){const{handleError:r}=await import("../../../../../utils/error-messages/handleError.js");r("adjustTrimDateError","Adjust trim date error: ",t)}}